package replit;

public class Task059a {
/***For you to do:**

 Write a program that prints the string "Hey, it is year:
 " and the years between 2011 and 2019.

 Must include year 2019 in the output

 **Output:**
 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for (int i = 2011; i <= 2019; i++) {
			System.out.println("Hey it is a year: ");
			System.out.println(i);
		}
	}

}
